INSERT INTO page(id,description,titre) VALUES
(1,"Si vous vous réveillez souvent avec une mare de salive embarrassante saturant votre oreiller d'une manière plutôt mignonne, vous devriez peut-être apporter quelques modifications à vos habitudes de sommeil. Pour certaines personnes, dormir simplement sur le dos peut les empêcher de baver, tandis que d'autres, souffrant d'apnée du sommeil, peuvent avoir besoin d'un traitement plus sérieux. Essayez quelques-unes des suggestions ci-dessous et consultez un médecin au sujet de votre état si vous continuez à baver pendant la nuit.","Comment arrêter de baver pendant son sommeil"),
(2,"Les cochons d'Inde sont des animaux très fragiles et sont sensibles à la fois à la chaleur et au froid. En hiver, vous devrez vous assurer de garder le vôtre au chaud ! La meilleure solution est de le faire entrer à l'intérieur de la maison. Quel que soit l'endroit où se trouve sa cage, à l'extérieur ou à l'intérieur, il y a des objets que vous pouvez y mettre pour l'isoler. Dans cette perspective, vous pourriez utiliser des coussins chauffants au microonde, adaptés aux animaux. Si vous disposez d'une cage installée à l'extérieur, vous devez vous assurer d'isoler les parois ainsi que le plancher afin de lui fournir plus de chaleur.","Comment garder un cochon d'Inde au chaud"),
(3,"Un canapé en daim semble doux et élégant tant qu'il reste propre et entretenu. C'est une chose qui est possible grâce à un nettoyage et un brossage rapides et réguliers ainsi qu'à un coup d'aspirateur de temps en temps. Si le vôtre est neuf et plutôt propre, vous pouvez le traiter avec plusieurs produits antitaches que vous pourrez trouver dans un magasin de bricolage. Cependant, les canapés plus vieux et plus sales nécessitent un nettoyage plus en profondeur.","Comment nettoyer et entretenir un canapé en daim"),
(4,"Vous venez enfin de terminer à grand-peine d'arracher la tapisserie de vos murs, mais il vous reste encore une tâche ardue à réaliser avant de pouvoir les peindre. La colle qui sert à faire adhérer le papier peint aux murs est généralement faite à base d'amidon ou de méthylcellulose. Si vous n'enlevez pas cette colle avant de peindre les murs, la peinture risque de s'écailler, de se décolorer ou de présenter un aspect inégal.","Comment faire partir la colle à papier peint"),
(5,"Il faut beaucoup de temps et d'efforts pour développer une bonne voix pour chanter dans les aigus. Si vous suivez ces étapes régulièrement, votre voix commencera à changer. Si vous faites de vrais efforts, cette méthode fonctionne réellement. Le plus important est de penser à respirer dès que vous pouvez. C'est très important, car si vos poumons ne reçoivent pas assez d'air, vous ne vous sentirez pas bien.","Comment développer une voix puissante pour chanter dans les aigus"),
(6,"Nombreux sont les cas dans lesquels il peut être nécessaire de calmer un chat. Par exemple, votre chat a peut-être du mal à supporter les déplacements en voiture ou bien il a tendance à stresser chez le vétérinaire. Heureusement, vous avez à votre disposition de nombreux moyens, médicaux ou non, pour calmer votre chat dans des situations stressantes. Cependant, vous devrez expérimenter prudemment diverses solutions pour déterminer celle qui convient le mieux à votre animal.","Comment calmer un chat avec des sédatifs"),
(7,"Avant d’acheter des carreaux pour faire des travaux, vous devez être capable de distinguer ceux en porcelaine de ceux en céramique. Ces deux matières sont composées d’un mélange d’argiles et d’autres matériaux et cuites dans un four et les deux types de carreaux appartiennent à la catégorie des « carreaux en céramique ». Ceux-ci sont divisés en deux groupes : les carreaux en porcelaine et en céramique (pas en porcelaine). En général, ceux en porcelaine sont de meilleure qualité et plus résistants, car ils sont composés de matériaux moins poreux et cuits à une température plus élevée [1]	X		Source de recherche						.","Comment faire la différence entre des carreaux en céramique et en porcelaine"),
(8,"Les lézards sont des animaux de compagnie de plus en plus populaires parce qu'il est relativement facile de s'en occuper. En fait, les soins à apporter sont différents selon l'espèce à laquelle appartient son lézard, cependant, il y a quelques règles qui s'appliquent à tous ces reptiles.","Comment s'occuper d'un lézard"),
(9,"Si elle n'est pas traitée, la déshydratation peut devenir un problème très grave. Vous devez apprendre à reconnaitre rapidement ses symptômes et à tout de suite refaire le plein de liquide. La soif, une altération de la vision et une douleur physique doivent vous alerter. Rendez-vous tout de suite chez un médecin si vous êtes sévèrement déshydraté au point de ressentir des choses comme une accélération du rythme cardiaque. Pour prévenir la déshydratation à l'avenir, modifiez vos habitudes.","Comment savoir si l'on est déshydraté"),
(10,"Aimeriez-vous avoir un lézard en tant qu'animal de compagnie ? Ils peuvent être d'excellents animaux à garder à la maison, car ils demandent peu de soin. Ils ne font pas de bruit, ils ne sont pas sales et ils n'ont pas besoin de beaucoup d'attention [1]	X		Source de recherche						. Toutefois, veillez à ne pas attraper un lézard sauvage afin de le garder comme animal de compagnie. La capture d'un lézard sauvage le stressera et il pourrait en mourir [2]	X		Source de recherche						.","Comment attraper un lézard et l'élever à la maison"),
(11,"L'embarras n'est pas quelque chose que les gens recherchent en général lorsqu'ils interagissent avec d'autres personnes. Ce sentiment n'est cependant pas nécessairement négatif. En fait, cela peut être agréable surtout si c'est vous qui êtes celui qui fait ressentir cela à quelqu'un d'autre. Même si mettre un ami dans cette position ne vous rendra certainement pas charmant, l'embarrasser peut être une source de plaisir pour votre côté espiègle. L'embarras peut être contagieux et l'une des façons de faire ressentir cela aux autres est de commencer à agir de manière embarrassante.","Comment faire en sorte qu'une personne se sente embarrassée"),
(12,"Savoir rouler un sac de couchage est l'une des compétences de base de tout campeur qui se respecte. Les sacs de couchage sont assez simples à rouler, même s'ils existent sous une grande variété de formes et de modalités de rangement. Une fois que vous savez comment rouler votre duvet, il est en général facile de procéder à l'opération.","Comment rouler un sac de couchage"),
(13,"Il existe des effets que tu dois tout le temps avoir dans ton sac à main. Ainsi, tu seras toujours prête pour pratiquement toutes les occasions.","Comment apprêter chaque jour son sac à main (pour les adolescentes)"),
(14,"Le riz à la brésilienne consiste à faire dorer les grains de riz à un certain moment de la cuisson. La recette la plus traditionnelle est aromatisée avec des ognons et de l'ail, mais il existe des recettes alternatives qui peuvent inclure d'autres ingrédients comme du lait de coco, du sucre roux ou des brocolis.","Comment cuisiner le riz à la brésilienne"),
(15,"Que vous vouliez devenir président des élèves, maire ou député, il existe des techniques de base à connaitre si vous voulez gagner une élection. Pour convaincre les gens de voter pour vous, vous devez les connaitre, avoir confiance en votre équipe et croire que vous êtes le meilleur pour le poste. Si vous prenez le temps de comprendre vos électeurs potentiels et si vous faites passer votre message, vous pouvez les amener à voter pour vous.","Comment persuader les gens de voter pour moi"),
(16,"Les cocottes-minute indiennes permettent de cuire des aliments très vite à une température élevée en utilisant une pression très forte, comme les autres cocottes-minute. Ce genre d'ustensile est plutôt utilisé sur le feu, il utilise des poids pour régler la pression et il produit un sifflement qui vous indique quand le contenu a atteint la pression souhaitée. Vous pouvez l'utiliser pour faire cuire de nombreux plats indiens à base de riz, y compris le riz nature, le biryani et d'autres types de plats au riz.","Comment préparer du riz dans une cocotte‐minute indienne"),
(17,"Si vous choisissez de garder un lapin domestique à l'extérieur en permanence ou une partie du temps, vous devez prendre les précautions nécessaires pour qu'il reste heureux et en bonne santé. Les lapins domestiques ont besoin d'un environnement extérieur spacieux, sûr, propre, sec, ni trop chaud, ni trop froid, avec de bonnes sources d'eau et de nourriture. Ils doivent avoir un contact régulier avec des êtres humains et d'autres lapins qui pourraient être présents. Aidez votre lapin à mener une vie assez longue et heureuse pour le faire sauter de joie !","Comment prendre soin d'un lapin d'extérieur"),
(18,"Avoir un morceau de popcorn coincé entre les dents peut-être irritant et assez douloureux. À la différence d’autres aliments, les cosses de popcorn ne se dissolvent pas facilement dans la salive. De ce fait, elles peuvent rester longtemps coincées le long des lignes des gencives et entre les dents. Si vous ne les enlevez pas comme il se doit, les débris de nourriture comme les restes de popcorn qui se trouvent dans les crevasses difficiles à atteindre peuvent occasionner des abcès. Ces derniers peuvent à leur tour se remplir de bactéries et conduire à une infection de la gencive probablement grave. Le fait d’apprendre à gérer ce genre d’inconvénient avant que cela ne devienne un réel problème peut vous permettre de mieux vous sentir et d’éviter des infections douloureuses.","Comment enlever du popcorn de ses dents"),
(19,"Il ne fait aucun doute que vous serez frustré si vous constatez que vos chaussures sont éraflées. Plus elles sont éraflées, pire sera leur aspect et vous pourriez même envisager de les jeter. Il existe toutefois plusieurs moyens efficaces de nettoyer une paire de chaussures pour que celle-ci puisse encore conserver son attrait pendant quelques années de plus. Certaines méthodes nécessitent l'utilisation de produits domestiques, tandis que d'autres requièrent l'emploi d'articles spécifiquement conçus pour les chaussures. Dès lors que vous avez fini de nettoyer vos chaussures, vous devez prendre quelques mesures de sauvegarde pour avoir la certitude qu'elles demeurent neuves et propres.","Comment éliminer les éraflures noires de ses chaussures"),
(20,"N'avez-vous jamais eu envie de fuir ? Il y a plusieurs raisons pour lesquelles les jeunes voudraient s'enfuir de leur maison : certaines d'entre elles sont bonnes et certaines d'entre elles ne le sont pas vraiment. La chose la plus importante à comprendre pour les jeunes est probablement que la fugue est beaucoup plus difficile et beaucoup moins glamour que vous pouvez le penser. Il y a des nuits froides et blanches, il y a du danger et de la faim, il y a le sentiment général d'être perdu et de ne pas vraiment savoir où vous devez aller. Cela étant dit, il peut y avoir des raisons légitimes de vouloir s'enfuir.","Comment s'enfuir de chez soi");
